let _markdown = "\n\nSettings [#settings]\n\nThe settings page at `/admin/settings` contains all configuration options for your LinkDen instance, organized into 11 sections. Each section has its own Save button.\n\n1. Profile [#1-profile]\n\n| Field               | Description                                  |\n| ------------------- | -------------------------------------------- |\n| Display Name        | Your name or brand shown on the public page  |\n| Avatar URL          | URL to your profile image                    |\n| Bio                 | A short tagline or description (textarea)    |\n| Show Verified Badge | Toggle to show a checkmark next to your name |\n\nSaves: `profile_name`, `bio`, `avatar_url`, `verified_badge`.\n\n2. SEO [#2-seo]\n\n| Field            | Description                                        |\n| ---------------- | -------------------------------------------------- |\n| Page Title       | The `<title>` tag for your public page             |\n| Meta Description | Meta description for search engines (textarea)     |\n| OG Image URL     | Open Graph image shown when shared on social media |\n\nSaves: `seo_title`, `seo_description`, `seo_og_image`.\n\n3. Contact Form [#3-contact-form]\n\n| Field               | Description                                                  |\n| ------------------- | ------------------------------------------------------------ |\n| Enable Contact Form | Toggle on/off                                                |\n| Delivery Mode       | `Database only`, `Email notification`, or `Database + email` |\n\nWhen disabled, the contact form block is hidden from the public page.\n\n4. CAPTCHA [#4-captcha]\n\n| Field      | Description                                           |\n| ---------- | ----------------------------------------------------- |\n| Provider   | `None`, `Cloudflare Turnstile`, or `Google reCAPTCHA` |\n| Site Key   | Public key (shown when provider is not \"none\")        |\n| Secret Key | Server-side key (shown when provider is not \"none\")   |\n\nCAPTCHA keys are stored in the database, not in environment variables.\n\n5. Email [#5-email]\n\n| Field        | Description                            |\n| ------------ | -------------------------------------- |\n| Provider     | `Resend` or `Cloudflare Email Workers` |\n| API Key      | Provider API key (password input)      |\n| From Address | Verified sender email address          |\n\nRequired for contact form email notifications.\n\n6. Branding [#6-branding]\n\n| Field                  | Description                                |\n| ---------------------- | ------------------------------------------ |\n| Show Whitelabel Footer | Toggle the \"Powered by LinkDen\" footer     |\n| Custom Text            | Footer text when whitelabel is enabled     |\n| Custom Link            | Footer link URL when whitelabel is enabled |\n\n7. vCard [#7-vcard]\n\n| Field        | Description                                         |\n| ------------ | --------------------------------------------------- |\n| Enable vCard | Toggle the vCard download button on the public page |\n\nSee [vCard](/docs/features/vcard) for configuring vCard data fields.\n\n8. Apple Wallet [#8-apple-wallet]\n\n| Field               | Description                                     |\n| ------------------- | ----------------------------------------------- |\n| Enable Apple Wallet | Toggle wallet pass generation                   |\n| Team ID             | Apple Developer team identifier                 |\n| Pass Type ID        | Registered pass type identifier                 |\n| Custom QR URL       | Optional custom URL for the QR code on the pass |\n\nSee [Apple Wallet](/docs/features/apple-wallet) for detailed setup.\n\n9. Export / Import [#9-export--import]\n\n* **Export** -- Download a complete backup as JSON. Includes blocks, settings, social networks, and contact submissions.\n* **Import** -- Upload a JSON file to restore data. Supports `merge` mode.\n\n10. About [#10-about]\n\n* Shows the current app version from `version.json`.\n* Checks for updates against GitHub releases.\n* \"Update to X.X.X\" button with link to the release page when an update is available.\n* Link to the GitHub repository.\n";
