let _markdown = "\n\nBlock Builder [#block-builder]\n\nThe block builder at `/admin/builder` is where you create and organize all the content on your public link page. It supports 5 block types and drag-and-drop reordering with a live phone preview.\n\nLayout [#layout]\n\nThe builder uses a two-panel layout:\n\n* **Left panel** -- Block list with all your blocks in display order.\n* **Right panel** -- Live phone preview (visible on `lg` screens and above). On mobile, a floating action button opens the preview in a modal overlay.\n\nBlock List [#block-list]\n\nEach block row shows:\n\n* **Grip handle** -- Drag to reorder.\n* **Block type icon** -- Visual indicator of the block type.\n* **Title** -- The block title.\n* **URL** -- The destination URL (if applicable).\n* **Action buttons** (on hover):\n  * **Toggle visibility** -- Eye icon (green when enabled, toggles `isEnabled`).\n  * **Edit** -- Pencil icon, opens the edit panel.\n  * **Delete** -- Trash icon.\n\nDisabled blocks render at 60% opacity.\n\nAdding a Block [#adding-a-block]\n\nClick the **Add Block** button to open a dropdown menu listing all 5 block types:\n\n| Type             | Description                                                                     |\n| ---------------- | ------------------------------------------------------------------------------- |\n| **Link**         | A clickable button with title and URL                                           |\n| **Header**       | A text heading with configurable level (h1-h6), alignment, and optional divider |\n| **Social Icons** | A row of social media icon links with configurable size, style, and spacing     |\n| **Embed**        | Embed content from YouTube, Spotify, SoundCloud, or a custom URL                |\n| **Contact Form** | An inline contact form with customizable button text and success message        |\n\nBlock Edit Panel [#block-edit-panel]\n\nClicking edit on any block opens a slide-in panel from the right with 4 tabs:\n\nContent Tab [#content-tab]\n\nFields vary by block type:\n\n* **Link**: Title, URL\n* **Embed**: Title, embed type (YouTube, Spotify, SoundCloud, Custom), embed URL\n* **Social Icons**: Title, social icons JSON\n* **Header** / **Contact Form**: Title\n\nStyle Tab [#style-tab]\n\n* Icon name input\n* Config JSON textarea for advanced configuration\n\nOptions Tab [#options-tab]\n\nReference text listing common config keys: `noFollow`, `newTab`, `animation`, `thumbnail`.\n\nSchedule Tab [#schedule-tab]\n\n* Start date/time (`datetime-local` input)\n* End date/time (`datetime-local` input)\n* **Clear schedule** button\n\nBlocks outside their scheduled window are automatically hidden from the public page.\n\nBlock Configuration [#block-configuration]\n\nAll block types share a base configuration with these style options:\n\n| Option              | Description                |\n| ------------------- | -------------------------- |\n| `colorVariant`      | Color preset for the block |\n| `customBgColor`     | Custom background color    |\n| `customTextColor`   | Custom text color          |\n| `customBorderColor` | Custom border color        |\n| `borderRadius`      | Corner rounding            |\n| `borderWidth`       | Border thickness           |\n| `shadow`            | Drop shadow                |\n| `animation`         | Hover/entrance animation   |\n| `padding`           | Inner spacing              |\n\nReordering Blocks [#reordering-blocks]\n\nDrag any block by its grip handle to reorder. The new order is saved immediately via the `blocks.reorder` mutation.\n\nPhone Preview [#phone-preview]\n\nThe right panel shows a phone-frame preview (280px wide) with:\n\n* A light/dark mode toggle button.\n* Only `isEnabled: true` blocks rendered.\n* Type-specific preview rendering:\n  * **Link**: Button-style bar\n  * **Header**: Centered bold text\n  * **Social Icons**: Placeholder circles\n  * **Embed**: Gray box with embed type label\n  * **Contact Form**: Stacked input placeholders\n* Empty state message when no enabled blocks exist.\n\nVisibility Toggle [#visibility-toggle]\n\nEach block has a visibility toggle. Toggling a block off hides it from the public page but keeps it in your builder list. This is useful for:\n\n* Temporarily removing a block without deleting it.\n* Preparing blocks in advance and enabling them later.\n* Time-limited or seasonal content (or use scheduling instead).\n";
