let _markdown = "\n\nAdmin Dashboard [#admin-dashboard]\n\nThe admin dashboard at `/admin` is your command center for managing your LinkDen instance. It provides an overview of key metrics and quick access to all admin features.\n\nAccessing the Dashboard [#accessing-the-dashboard]\n\n1. Navigate to `/admin` on your LinkDen instance.\n2. Sign in with your Better Auth credentials (email/password) at `/admin/login`.\n3. You land on the dashboard.\n\nIf this is your first time, you will be redirected to the setup wizard at `/admin/setup` instead.\n\nDashboard Layout [#dashboard-layout]\n\nHeader [#header]\n\nThe page header includes two action buttons:\n\n* **Builder** -- Links to `/admin/builder` to manage your blocks.\n* **View Page** -- Opens your public page in a new tab.\n\nStat Cards [#stat-cards]\n\nThree stat cards are displayed in a 3-column grid:\n\n| Card                | Icon                      | Description                                                           |\n| ------------------- | ------------------------- | --------------------------------------------------------------------- |\n| **Total Views**     | Eye (blue)                | Total page views over the last 7 days                                 |\n| **Total Clicks**    | MousePointerClick (green) | Total link clicks over the last 7 days                                |\n| **Unread Contacts** | Mail (orange)             | Count of unread contact form submissions (links to `/admin/contacts`) |\n\nViews Chart [#views-chart]\n\nA bar chart showing page views over the last 7 days. Each bar displays the view count on hover. Day labels show short weekday names. A \"View all\" link navigates to the full analytics page at `/admin/analytics`.\n\nVersion Card [#version-card]\n\nShows the current app version. If an update is available, displays an \"Update to X.X.X\" button linking to the release page. Otherwise shows \"Up to date\".\n\nNavigation [#navigation]\n\nThe dashboard links to the key admin sections:\n\n* `/admin/builder` -- Block builder with drag-and-drop reordering\n* `/admin/analytics` -- Full analytics dashboard\n* `/admin/contacts` -- Contact form submissions\n* `/admin/social` -- Social network management\n* `/admin/settings` -- All configuration options\n* `/admin/appearance` -- Theme and color customization\n";
